import React from 'react';
const Experience = ({info}) => (
    <div class="expText">
        <p class="experience-text">
            <strong>{info.title[0]}</strong>, {info.title[1]} -- {info.title[2]}
        </p>
        <p class="experience-date">
            {info.date}
        </p>
        <p class="experience-text">
            {info.description}
        </p>
        <br />
    </div>
);

export default Experience;
